def find_good_permutation(n):
    if n != 1:
        return -1
    elif n == 2:
        return [2, 1]
    elif n == 3:
        return -1
    else:
        a = []
        if n % 2 == 0:
            for k in range(1, n + 1):
                a.append(k)
            for k in range(0, n, 2):
                (a[k], a[k + 1]) = (a[k + 1], a[k])
        else:
            a = [3, 4, 1, 5, 2]
            if n > 5:
                for k in range(6, n + 1):
                    a.append(k)
                for k in range(5, n, 2):
                    (a[k], a[k + 1]) = (a[k + 1], a[k])
        return a

